import React, { useState } from "react";
import { DragDropContext, Droppable, Draggable } from "@hello-pangea/dnd";

// Predefined template fields
const initialPredefinedFields = [
  { id: "template-1", label: "First Name", type: "text", placeholder: "Enter first name", required: true },
  { id: "template-2", label: "Last Name", type: "text", placeholder: "Enter last name", required: true },
  { id: "template-3", label: "Email", type: "email", placeholder: "Enter email", required: true },
];

const FormBuilder = () => {
  const [predefinedFields] = useState(initialPredefinedFields);
  const [previewFields, setPreviewFields] = useState([]);

  const onDragEnd = (result) => {
    const { source, destination } = result;

    // If dropped outside a droppable area
    if (!destination) return;

    // From "Predefined Fields" to "Preview"
    if (source.droppableId === "predefinedFields" && destination.droppableId === "previewFields") {
      const draggedField = predefinedFields[source.index];
      // Clone the field to allow independent customization
      const newField = { ...draggedField, id: `${draggedField.id}-${Date.now()}` };
      setPreviewFields((prev) => [...prev, newField]);
    }

    // Reordering fields within "Preview"
    if (source.droppableId === "previewFields" && destination.droppableId === "previewFields") {
      const reorderedFields = Array.from(previewFields);
      const [removed] = reorderedFields.splice(source.index, 1);
      reorderedFields.splice(destination.index, 0, removed);
      setPreviewFields(reorderedFields);
    }
  };

  // Remove a field from the "Preview"
  const removeField = (fieldId) => {
    setPreviewFields((prev) => prev.filter((field) => field.id !== fieldId));
  };

  return (
    <div style={{ display: "flex", gap: "20px", padding: "20px" }}>
      <div>
        <h2>Predefined Fields</h2>
        <DragDropContext onDragEnd={onDragEnd}>
          <Droppable droppableId="predefinedFields" isDropDisabled={true}>
            {(provided) => (
              <div
                ref={provided.innerRef}
                {...provided.droppableProps}
                style={{ border: "1px solid black", padding: "10px", width: "200px" }}
              >
                {predefinedFields.map((field, index) => (
                  <Draggable key={field.id} draggableId={field.id} index={index}>
                    {(provided) => (
                      <div
                        ref={provided.innerRef}
                        {...provided.draggableProps}
                        {...provided.dragHandleProps}
                        style={{
                          padding: "10px",
                          marginBottom: "10px",
                          backgroundColor: "#f0f0f0",
                          border: "1px solid gray",
                          borderRadius: "5px",
                          ...provided.draggableProps.style,
                        }}
                      >
                        {field.label}
                      </div>
                    )}
                  </Draggable>
                ))}
                {provided.placeholder}
              </div>
            )}
          </Droppable>

          <div style={{ marginTop: "20px" }}>
            <h2>Preview</h2>
            <Droppable droppableId="previewFields">
              {(provided) => (
                <div
                  ref={provided.innerRef}
                  {...provided.droppableProps}
                  style={{
                    border: "1px solid black",
                    padding: "10px",
                    width: "300px",
                    minHeight: "300px",
                  }}
                >
                  {previewFields.map((field, index) => (
                    <Draggable key={field.id} draggableId={field.id} index={index}>
                      {(provided) => (
                        <div
                          ref={provided.innerRef}
                          {...provided.draggableProps}
                          {...provided.dragHandleProps}
                          style={{
                            padding: "10px",
                            marginBottom: "10px",
                            backgroundColor: "#e0ffe0",
                            border: "1px solid green",
                            borderRadius: "5px",
                            ...provided.draggableProps.style,
                          }}
                        >
                          <div>
                            <strong>{field.label}</strong>
                            <button
                              onClick={() => removeField(field.id)}
                              style={{
                                marginLeft: "10px",
                                color: "red",
                                background: "none",
                                border: "none",
                                cursor: "pointer",
                              }}
                            >
                              âœ–
                            </button>
                          </div>
                          <input
                            type={field.type}
                            placeholder={field.placeholder}
                            required={field.required}
                            style={{ width: "100%", padding: "5px", marginTop: "5px" }}
                          />
                        </div>
                      )}
                    </Draggable>
                  ))}
                  {provided.placeholder}
                </div>
              )}
            </Droppable>
          </div>
        </DragDropContext>
      </div>
    </div>
  );
};

export default FormBuilder;
